 n’a pas\r\nmangé le pain de\r\nl’oisiveté. Parents et amis, ne\r\nm’oubliez pas\r\ndans vos prières;\r\ncommuniez souvent pour moi. Pourquoi pleurer mon\r\ndépart, puisque la mort est\r\nla fin de mes souffrances.\r\n« J’ai rejoint ceux que\r\nj’aime au ciel,\r\nlà où la famille se\r\nreformera. »\r\n',NULL,NULL,NULL,'',29,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(44,1,NULL,NULL,NULL,'Ton souvenir\r\nest comme un livre\r\nqu’on lit et relit\r\nsans ne jamais\r\nle refermer.\r\n',NULL,NULL,'photo-30.jpg','',30,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(45,1,NULL,NULL,NULL,'Il y a repos\r\npour le peuple de Dieu.\r\n[ORN-9]\r\nMerci,\r\nd’avoir partagé\r\nnotre chagrin.\r\n',NULL,NULL,NULL,'',30,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(46,1,NULL,NULL,NULL,'',NULL,NULL,'photo-31.jpg','',31,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(47,1,NULL,NULL,NULL,'Lors de la perte\r\ninestimable\r\nde notre cher papa\r\nMonsieur\r\nArmand Racine\r\nnous vous sommes\r\nextrêmement\r\nreconnaissants de toutes\r\nvos bienveillances à\r\nnotre égard.\r\nSes enfants\r\nClaude, André et\r\nMireille.\r\nD’avoir ceux\r\nque nous estimons\r\nauprès de nous,\r\nnous donne\r\nforce et courage\r\npour surmonter cette\r\ndure épreuve de la vie.\r\nSincères remerciements\r\nLes familles\r\nRacine et Poulin\r\nD’avoir ceux\r\nque nous estimons\r\nauprès de nous,\r\nnous donne\r\nforce et courage\r\npour surmonter cette\r\ndure épreuve de la vie.\r\nSincères remerciements\r\nLes familles\r\nRacine et Poulin\r\nMme Carole Racine\r\nClaude, André\r\net Mireille\r\nsensibles aux\r\ntémoignages de\r\nsympathie\r\nque vous leur\r\navez adressés\r\nà la suite du décès de\r\nMonsieur\r\nArmand Racine\r\nvous prient d’agréer\r\nleur profonde gratitude.\r\nMme Carole Racine\r\nClaude, André\r\net Mireille\r\nsensibles aux\r\ntémoignages de\r\nsympathie\r\nque vous leur\r\navez adressés\r\nà la suite du décès de\r\nMonsieur\r\nArmand Racine\r\nvous prient d’agréer\r\nleur profonde gratitude.\r\nVous avez eu\r\nla délicatesse\r\nlors du décès de\r\nMonsieur\r\nArmand Racine\r\nde nous témoigner par\r\nun geste personnel\r\nla part que vous preniez\r\nà notre peine.\r\nNous en avons été\r\nsincèrement touchés\r\net tenons à vous dire\r\nnotre profonde\r\ngratitude.\r\nMme Carole Racine\r\nClaude, André et\r\nMireille.\r\nPour le réconfort que vous nous avez apporté lors du décès de M. Armand Racinenous vous assurons de notre vive reconnaissance et nous vous remercions sincèrement. Madame Carole Racine Claude, André et Mireille\r\nLes membres de\r\nla famille Racine\r\nvous remercient\r\nd’avoir été présents\r\net d’avoir partagé\r\nleur espérance chrétienne\r\nen ces jours difficiles où\r\nM. Armand Racine\r\nest passé de ce monde\r\nau Père.  \r\nLes membres de\r\nla famille Racine\r\nvous remercient\r\nd’avoir été présents\r\net d’avoir partagé\r\nleur espérance chrétienne\r\nen ces jours difficiles où\r\nM. Armand Racine\r\nest passé de ce monde\r\nau Père.  \r\nEn ce jour où le Seigneur\r\na rappelé à Lui\r\nmon époux, notre père\r\nM. Armand  Racine\r\nvous avez prié pour lui\r\net vous nous avez\r\nmanifesté votre amitié\r\nréconfortante.\r\nNous vous en sommes\r\ngrandement\r\nreconnaissants.\r\nLes membres de\r\nla famille Racine.\r\nEn ce jour où le Seigneur\r\na rappelé à Lui\r\nmon époux, notre père\r\nM. Armand  Racine\r\nvous avez prié pour lui\r\net vous nous avez\r\nmanifesté votre amitié\r\nréconfortante.\r\nNous vous en sommes\r\ngrandement\r\nreconnaissants.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nNous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nM. Armand Racine.\r\nLes membres de\r\nla famille Racine.\r\nMme Carole Racine\r\nClaude, André\r\net Mireille\r\nsensibles aux\r\ntémoignages de\r\nsympathie\r\nque vous leur\r\navez adressés\r\nà la suite du décès de\r\nMonsieur\r\nArmand Racine\r\nvous prient d’agréer\r\nleur profonde gratitude.\r\nMme Carole Racine\r\nClaude, André\r\net Mireille\r\nsensibles aux\r\ntémoignages de\r\nsympathie\r\nque vous leur\r\navez adressés\r\nà la suite du décès de\r\nMonsieur\r\nArmand Racine\r\nvous prient d’agréer\r\nleur profonde gratitude.\r\nPour la sympathie\r\nque vous nous\r\navez témoignée\r\nlors du décès de\r\nMonsieur\r\nArmand Racine\r\nveuillez croire\r\nen notre profonde\r\nreconnaissance\r\net daignez agréer\r\nl’expression\r\nde nos plus sincères\r\nremerciements.\r\nMme Carole Racine\r\nClaude, André et\r\nMireille.\r\nPar votre support moral\r\ndans notre\r\ngrande affliction\r\nlors du décès de\r\nMonsieur\r\nArmand Racine\r\nvous avez su nous\r\ndonner\r\nla force d’accepter\r\ncette grande épreuve\r\navec plus de courage.\r\nMerci\r\nMme Carole Racine\r\nClaude, André et\r\nMireille.\r\nPar votre support moral\r\ndans notre\r\ngrande affliction\r\nlors du décès de\r\nMonsieur\r\nArmand Racine\r\nvous avez su nous\r\ndonner\r\nla force d’accepter\r\ncette grande épreuve\r\navec plus de courage.\r\nMerci\r\nMme Carole Racine\r\nClaude, André et\r\nMireille.\r\nSi le grain de blé\r\nne meurt\r\nil ne porte fruit.\r\n',NULL,NULL,NULL,'',31,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(48,1,NULL,NULL,NULL,'Le mystère\r\nde notre vie\r\nest entre les mains\r\nde Dieu.\r\n[ORN-02]\r\n',NULL,NULL,'photo-32.jpg','',32,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(49,1,NULL,NULL,NULL,'Les souvenirs\r\nqu’on a de lui\r\ngardent l’être cher\r\ntoujours vivant\r\ndans notre esprit.\r\n[ORN-12]\r\n',NULL,NULL,NULL,'',32,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(50,1,NULL,NULL,NULL,'La mort\r\nc’est la vie affranchie,\r\nc’est le semeur du ciel\r\nqui coupe sur la tombe\r\nune dernière gerbe et\r\njette sa moisson\r\nsous les pieds\r\ndu Seigneur.\r\n',NULL,NULL,NULL,'',33,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(51,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',33,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(52,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',34,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(53,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',34,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(54,1,NULL,NULL,NULL,'Au seuil\r\nde notre détresse,\r\nvous étiez là...\r\nAvec l’appui de ceux\r\nqui sont près de nous\r\nil est plus facile\r\nde trouver la force\r\net le courage\r\nde supporter l’épreuve.\r\nRegardez la vie\r\nque je commence\r\net non celle\r\nque je finis.\r\nVotre attention\r\nnous a touchés.\r\nMerci\r\n',NULL,NULL,NULL,'',35,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(55,1,NULL,NULL,NULL,'Il n’a vécu\r\nque le temps d’une rose.\r\nIl nous a\r\ntellement apporté\r\nqu’on ne pourra\r\njamais l’oublier !\r\n',NULL,NULL,NULL,'',35,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(56,1,NULL,NULL,NULL,'',NULL,NULL,'photo-36.gif','',36,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(57,1,NULL,NULL,NULL,'',NULL,NULL,'back-36.gif','',36,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(58,1,NULL,NULL,NULL,'Je ne vous oublie pas...\r\nÀ la douce\r\nmémoire de\r\nMaurice Caron',NULL,NULL,NULL,'',37,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(59,1,NULL,NULL,NULL,'Par votre présence et\r\nvotre témoignage\r\nd’amitié\r\nlors du décès de\r\nM. Maurice Caron\r\nvous avez su nous\r\ndonner réconfort\r\net espérance.\r\nNous vous en\r\nremercions sincèrement.\r\n\r\nLa famille\r\n',NULL,NULL,NULL,'',37,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(60,1,NULL,NULL,NULL,'Je vous salue Marie,\r\npleine de grâces\r\nle Seigneur est avec vous.\r\nVous êtes bénie\r\nentre toutes les femmes\r\net Jésus, le fruit de vos\r\nentrailles,\r\nest béni.\r\nSainte Marie,\r\nmère de Dieu,\r\npriez pour nous,\r\npauvres pêcheurs,\r\nmaintenant et à l’heure\r\nde notre mort.\r\n(Amen)\r\n[ORN-13]\r\ngfdgfdgfdgd\r\n\r\n',NULL,NULL,NULL,'',38,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(61,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',38,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(62,1,NULL,NULL,NULL,'Je vous salue Marie,\r\npleine de grâces\r\nle Seigneur est avec vous.\r\nVous êtes bénie\r\nentre toutes les femmes\r\net Jésus, le fruit de vos\r\nentrailles,\r\n