 d\'une fleur perd de son éclat et meurt avec le temps mais l\'amour d\'une mère ne meurt jamais.\r\n\r\n\r\nMonsieur Roger Pouliot, Diane, Jocelyne et Josée vous remercient d\'avoir été présents et ils ont été très touchés par les marques de sympathie que vous leur avez témoignées.\r\n\r\n\r\nSincères remerciements.\r\n\r\n[ORN-26]\r\n\r\n',NULL,NULL,NULL,'',10039,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(115,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nClaire Douville\r\n1929 - 2009\r\n',NULL,NULL,'photo-10040.tiff','',10040,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(116,1,NULL,NULL,NULL,'« J’ai rejoint\r\nceux que j’aimais et j’attends\r\nceux que j’aime. »\r\n(Bossuet)\r\n\r\n\r\n[ORN-03]\r\n',NULL,NULL,NULL,'',10040,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(117,1,NULL,NULL,NULL,'Alla cara memoria di\r\nLivia Guaiani Forlini\r\n13 Luglio 1943 - 8 Dicembre 2009\r\n',NULL,NULL,'photo-10041.tiff','',10041,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(118,1,NULL,NULL,NULL,'Consoltevi con me voi tutti\r\nche mi eravate tanto cari.\r\nLo lascio un mundo di dolori per un\r\nRegno di Pace.\r\n\r\nLa famiglia Forlini ringrazia \r\nsentitamente delle vostre condoglianze.\r\n',NULL,NULL,NULL,'',10041,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(119,1,NULL,NULL,NULL,'',NULL,NULL,'photo-10042.tiff','',10042,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(120,1,NULL,NULL,NULL,'En souvenir de \r\nMalvina Lemire Poirier\r\ndécédée le 9 décembre 2009\r\nà l\'âge de 97 ans\r\n',NULL,NULL,NULL,'',10043,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(121,1,NULL,NULL,NULL,'Elle va maintenant rejoindre\r\nceux qu\'elle aimait et attendre\r\nceux qui vont suivre.\r\nÀ vous tous chers parents et amis, merci d\'être venus si chaleureusement vous joindre à nous pour dire aurevoir à notre mère. Les enfants de Malvina: Lise, Pauline,Jean-Claude, Céline et Claire.\r\n',NULL,NULL,NULL,'',10043,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(122,1,NULL,NULL,NULL,'En mémoire de\r\nJean-Paul Gagnon\r\ndécédé le 8 décembre 2009\r\n',NULL,NULL,'photo-10044.tiff','',10044,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(123,1,NULL,NULL,NULL,'Une vie bien remplie…\r\nun repos bien mérité.\r\nLa sympathie que vous\r\nnous avez témoignée\r\ndans notre épreuve\r\nlors du décès de\r\nMonsieur\r\nJean-Paul Gagnon\r\nnous a été\r\nd’un grand réconfort.\r\nNous en garderons un\r\nsouvenir ému.\r\nSes enfants et ses petits-enfants\r\n[ORN-02]\r\n',NULL,NULL,NULL,'',10044,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(124,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nJohn Gorley\r\n',NULL,NULL,'photo-10045.tiff','',10045,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(125,1,NULL,NULL,NULL,'Il s’est éteint doucement,\r\nen paix avec son Dieu,\r\nlaissant les siens dans une douleur profonde.\r\nSa droiture, la bonté de\r\nson coeur lui gagnaient\r\nl’affection de tous\r\nceux qui l’entouraient.\r\nIl laisse à sa famille, un\r\nnom respecté et honoré,\r\nle souvenir d’un mari\r\naimant et dévoué, la\r\nmémoire d’un père qu’on\r\npeut chérir avec fierté.\r\nPère, là-haut, veille sur\r\nnous, souvent,\r\nviens nous béni\r\n',NULL,NULL,NULL,'',10045,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(126,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nPierre leroux\r\n',NULL,NULL,'photo-10046.tiff','',10046,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(127,1,NULL,NULL,NULL,'« C’est grand la mort\r\nc’est plein  de vie dedans. »\r\n(Félix Leclerc)\r\n[ORN-02]\r\nVotre présence\r\nnous a réconfortés.\r\nMerci\r\n\r\nThérèse, Carole, Gilles et Jean-Philippe\r\n',NULL,NULL,NULL,'',10046,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(128,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nMadame Lucienne Fillion\r\ndécédée le 7 décembre 2009\r\n',NULL,NULL,'photo-10047.tiff','',10047,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(129,1,NULL,NULL,NULL,'Nous espérons\r\nque ce message\r\nsaura vous dire\r\nà quel point\r\nnous avons apprécié\r\nvotre témoignage\r\nde sympathie\r\nlors du décès de\r\nMadame Lucienne Fillion Lachapelle\r\nAnnette, Gisèle, Hélène et Richard\r\n',NULL,NULL,NULL,'',10047,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(130,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nnotre petit ange\r\nNaïma\r\n',NULL,NULL,'photo-10048.tiff','',10048,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(131,1,NULL,NULL,NULL,'Tous attendions sa venue, tel un ange, un petit miracle pour chacun d\'entre nous. Aujourd\'hui, elle veille sur nous, assise sur son nuage d\'amour et de paix là-haut au paradis des anges.\r\nMaman et Papa\r\n',NULL,NULL,NULL,'',10048,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(132,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nJacqueline\r\nGuay\r\nBrassard\r\ndécédée le 9 décembre 2009\r\n',NULL,NULL,'photo-10049.tiff','',10049,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(133,1,NULL,NULL,NULL,'La perte d’un père\r\nest le premier chagrin\r\nque l’on pleure\r\nsans lui.\r\nTon souvenir\r\nest comme un livre\r\nqu’on lit et relit\r\nsans ne jamais\r\nle refermer.\r\n\r\n[ORN-01]\r\nPour nous,\r\nvous avez pris le temps…\r\nMerci\r\n',NULL,NULL,NULL,'',10049,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(134,1,NULL,NULL,NULL,'En souvenir de \r\nCamille Cloutier\r\n1928 - 2009\r\n',NULL,NULL,'photo-10050.tiff','',10050,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(135,1,NULL,NULL,NULL,'Mon Dieu, trop tôt hélas,\r\ntu es venu chercher cet\r\nêtre cher qui, connaissant\r\nla souffrance autant\r\nphysique que morale, ne\r\ncessait de combattre pour\r\ndes jours meilleurs. Une\r\nfois de plus encore; tu as\r\nchoisi le plus doux, le plus\r\ntendre des papas,\r\nl’ami réconfortant et\r\nsincère; mais en ton\r\nparadis si pur et si blanc\r\nsoit-il, essaie  de lui\r\ndonner une place de\r\ngrand choix et de rendre\r\nhommage à un Grand\r\nHomme qui a su\r\nquitter avec courage et\r\ndignité son humble\r\ndemeure dont il était si fier...\r\nEn son nom, Dieu\r\ntout-puissant, nous te\r\nremercions. Amen !\r\n[ORN-26]\r\n',NULL,NULL,NULL,'',10050,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(136,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nMadame\r\nEstrela\r\nCabral\r\nGalego\r\ndécédée le 9 décembre 2009\r\n\r\n',NULL,NULL,'photo-10051.tiff','',10051,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(137,1,NULL,NULL,NULL,'Chers enfants, je vous ai\r\nquittés non sans\r\ndéchirement; mais\r\nj’ai espéré dans le\r\nSeigneur.\r\nQuelle joie de contempler\r\nle Dieu d’amour et de lui\r\nconfier les secrets\r\nde vos coeurs.\r\nNe m’oubliez pas,\r\ncar  je suis toujours\r\navec vous.\r\nJe vous mets dans les\r\nbras du Seigneur afin\r\nqu’il vous protège.\r\nNe pleurez pas,\r\nje vais à Dieu.\r\nJ’ai rejoint\r\nceux que j’aimais\r\net j’attends\r\nceux que j’aime.\r\n(Bossuet)\r\n',NULL,NULL,NULL,'',10051,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(138,1,NULL,NULL,NULL,'',NULL,NULL,'photo-10052.tiff','',10052,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(139,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',10052,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(140,1,NULL,NULL,NULL,'Etiennette Desmeules\r\ndécédée le 9 décembre 2009\r\nà l\'âge de 63 ans\r\n',NULL,NULL,'photo-10053.tiff','',10053,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(141,1,NULL,NULL,NULL,'Nous avons écrit ton nom\r\ndans le sable\r\nMais la vague l’a effacé\r\nNous avons gravé ton nom\r\nsur un arbre\r\nMais l’écorce est tombée\r\nNous avons incrusté\r\nton nom\r\ndans le marbre\r\nMais la pierre a cassé\r\nNous avons enfoui\r\nton nom\r\ndans nos coeurs\r\nEt le temps l’a gardé\r\n[ORN-15]\r\n',NULL,NULL,NULL,'',10053,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(142,1,NULL,NULL,NULL,'À la douce\r\nChristiane Massé\r\ndécédée le 8 décembre 2009\r\n',NULL,NULL,'photo-10054.tiff','',10054,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(143,1,NULL,NULL,NULL,'La perte d’une mère\r\nest le premier chagrin\r\nque l’on pleure\r\nsans elle.\r\nUne étoile de plus brille\r\ndans le firmament.\r\nTant que,\r\ndans vos pensées\r\nje serai;\r\naussi longtemps,\r\nje vivrai.\r\n\r\n',NULL,NULL,NULL,'',10054,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(144,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nLucie Généreux\r\ndécédée le 8 décembre 2009\r\nà l\'âge de 41 ans\r\n',NULL,NULL,'photo-10055.tiff','',10055,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(145,1,NULL,NULL,NULL,'La perte d’un père\r\nest le premier chagrin\r\nque l’on pleure\r\nsans lui.\r\nNous avons écrit ton nom\r\ndans le sable\r\nMais la vague l’a effacé\r\nNous avons gravé ton nom\r\nsur un arbre\r\nMais l’écorce est tombée\r\nNous avons incrusté\r\nton nom\r\ndans le marbre\r\nMais la pierre a cassé\r\nNous avons enfoui\r\nton nom\r\ndans nos coeurs\r\nEt le temps l’a gardé\r\n',NULL,NULL,NULL,'',10055,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(146,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nEva Marcil\r\ndécédée le 9 décembre 2009\r\nà l\'âge de 87 ans\r\n',NULL,NULL,'photo-10056.tiff','',10056,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(147,1,NULL,NULL,NULL,'« Au bout du chemin\r\nde la vie,\r\nse trouve un seuil qui\r\nnous conduit\r\nde l’autre côté\r\nde la nuit,\r\nvers la lumière\r\noù nous attendent\r\nle repos et la paix... »\r\n[ORN-26]\r\n',NULL,NULL,NULL,'',10056,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(148,1,NULL,NULL,NULL,'',NULL,NULL,'photo-10057.tiff','',10057,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(149,1,NULL,NULL,NULL,'',NULL,NULL,'photo-10058.tiff','',10058,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(150,1,NULL,NULL,NULL,'',NULL,NULL,'photo-10059.tiff','',10059,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(151,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nKeven Duquet Ouellette\r\ndécédé le 6 décembre 2009\r\nà l\'âge de 17 ans\r\n',NULL,NULL,'photo-10060.tiff','',10060,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(152,1,NULL,NULL,NULL,'La mort ne m’a pas laissé\r\nle temps de vous\r\ndire adieu.\r\nDu haut du ciel,\r\nchers parents, chère soeur et amis\r\nbien-aimés, je vous suis\r\npas à pas, restez unis\r\nentre vous,\r\nne m’oubliez jamais.\r\nSeigneur, vous savez\r\ncombien je désirais être\r\nauprès des miens, pour\r\nleur faire du bien;\r\npuisque vous m’avez\r\nrappelé à vous, Seigneur,\r\nprenez ma place auprès\r\nd’eux, soyez leur ami et\r\nleur consolateur. \r\n\r\n[ORN-15]\r\n',NULL,NULL,NULL,'',10060,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(153,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nMarie-Claire\r\nFaubert\r\nDesrochers\r\n10 mars 1916 - 9 décembre 2009\r\n\r\n',NULL,NULL,'photo-10061.tiff','',10061,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(154,1,NULL,NULL,NULL,'La douleur\r\nest moins pénible\r\nlorsqu’elle est partagée.\r\n\r\nVotre présence\r\nnous a réconfortés.\r\nMerci\r\n\r\n',NULL,NULL,NULL,'',10061,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(155,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nSuzanne\r\nPlante\r\nDubuc\r\ndécédée le\r\n6 décembre 2009\r\n',NULL,NULL,'photo-10062.tiff','',10062,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(156,1,NULL,NULL,NULL,'Ne soyez pas tristes,\r\noubliez votre chagrin,\r\ncar là où je suis\r\nmaintenant,\r\nil n’y a ni larmes,\r\nni souffrance,\r\nni maladie, ni douleur.\r\nLe bonheur que je vis\r\ndans les cieux\r\nest encore plus grand\r\nque celui que j’ai connu\r\nsur terre.\r\nJ’ai trouvé auprès de Dieu\r\nla lumière et l’amour infini.\r\nRéjouissez-vous,\r\nIl veille sur moi\r\net m’a accordé le repos\r\net la paix éternelle.\r\n',NULL,NULL,NULL,'',10062,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(157,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nJacqueline\r\nMorin\r\n9 décembre 2009\r\nà l\'âge de 84 ans\r\n',NULL,NULL,'photo-10063.tiff','',10063,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(158,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',10063,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(159,1,NULL,NULL,NULL,'',NULL,NULL,'photo-10064.tiff','',10064,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(160,1,NULL,NULL,NULL,'En souvenir de \r\nMarie-Claire Caouette Allaire\r\n1919 - 2009\r\n',NULL,NULL,'photo-10065.tiff','',10065,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(161,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',10065,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(162,1,NULL,NULL,NULL,'In loving memory of Helena Mikulicz Wierzbicki\r\ndied on the 9th of December 2009\r\nat the age of 84\r\n',NULL,NULL,'photo-10066.tiff','',10066,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(163,1,NULL,NULL,NULL,'See the new life\r\nl am beginning\r\nand not the one\r\nl have ended.\r\nThe loss of a mother\r\nis the first sorrow in life,\r\nthat we face without her.\r\n',NULL,NULL,NULL,'',10066,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(164,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nMadame Andrée Normand\r\ndécédée le 7 décémbre 2009\r\n',NULL,NULL,'photo-10067.tiff','',10067,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(165,1,NULL,NULL,NULL,'1943 - 2009\r\nLors du décès de\r\nMme Andrée Normand\r\nvous nous avez apporté\r\nvotre appui\r\net votre réconfort.\r\nDe même que\r\nles grandes peines\r\nsont souvent muettes,\r\nune grande\r\nreconnaissance\r\npeut sembler discrète\r\nmais nous la ressentons\r\nprofondément\r\net nous vous remercions\r\ntrès sincèrement.\r\nGuy, Daniel, Patrice, Hugues.\r\n',NULL,NULL,NULL,'',10067,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(166,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nMarie\r\nRaymond\r\ndécédée le 8 décembre 2009\r\nà l\'âge de 81 ans\r\n',NULL,NULL,'photo-10068.tiff','',10068,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(167,1,NULL,NULL,NULL,'La perte d’un père\r\nest le premier chagrin\r\nque l’on pleure\r\nsans lui.\r\nNombreux sont\r\nles chemins.\r\nIl a pris celui qui plaisait\r\nà son coeur.\r\nIl a choisi\r\nd’aider son prochain.\r\nSa vie fut simple.\r\nIl aimait le soleil, la terre, la pluie.\r\nTout résonnait en lui\r\nd’un amour profond\r\net sincère.\r\nTout était manifestation\r\nd’une grande et\r\ninfinie beauté.\r\nChaque geste, chaque\r\nparole, chaque pensée\r\nétaient pour\r\nlui un renouvellement.\r\nIl a témoigné d’une\r\nimmense bonté et d’un\r\ndévouement remarquable.\r\nIl a su vivre intensément et\r\ncommuniquer cette\r\nchaleur à tous ceux\r\nqui l\'entouraient.\r\nPuisse-t-il reposer\r\nen paix ! \r\n\r\n[ORN-13]\r\nSeigneur,\r\nvous m’avez appelé\r\nprès de vous,\r\nj’ai laissé seuls ceux\r\nque j’aimais tant,\r\nprenez ma place\r\nauprès d’eux.\r\n',NULL,NULL,NULL,'',10068,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(168,1,NULL,NULL,NULL,'À la mémoire de\r\nAndré Fredette\r\n1923 - 2009\r\n',NULL,NULL,'photo-10069.tiff','',10069,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(169,1,NULL,NULL,NULL,'Il était un père tendre,\r\nvaillant et généreux, \r\nl’amour qu’il portait à sa\r\nfamille ne nuisait en rien à\r\nla charité qu’il devait à son\r\nDieu. Ceux qui le virent en\r\npassant, le regretteront et\r\nle pleureront toujours. Son\r\ncaractère droit et la bonté\r\nde son coeur lui\r\ngagnaient l’affection\r\nde tous ceux qui\r\nl’entouraient.\r\nSa mort a laissé dans nos\r\ncoeurs une plaie profonde.\r\n\r\nLa famille vous remercie de votre témoignage de sympathie.\r\n',NULL,NULL,NULL,'',10069,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(170,1,NULL,NULL,NULL,'À la douce\r\nmémoire de\r\nPaulette Beaudoin\r\ndécédée le 4 décembre 2009\r\n',NULL,NULL,'photo-10070.tiff','',10070,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(171,1,NULL,NULL,NULL,'Seigneur,\r\nvous m’avez appelé\r\nprès de vous,\r\nj’ai laissé seuls ceux\r\nque j’aimais tant,\r\nprenez ma place\r\nauprès d’eux.\r\n[ORN-15]\r\nMarcelC., Sykvie, Christine, Richard, Mario, Chantal et Jean-François.\r\n',NULL,NULL,NULL,'',10070,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(172,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',10071,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(173,1,NULL,NULL,NULL,'En souvenir de\r\nAndré Vadeboncoeur\r\n1936-2010\r\n',NULL,NULL,NULL,'',10072,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(174,1,NULL,NULL,NULL,'\r\n[pensée-100]\r\n\r\nRegardez la vie\r\nque je commence\r\net non celle\r\nque je finis.\r\n\r\n\r\n\r\n[ORN-26]\r\n\r\n\r\n[poème-003]\r\n\r\nNous avons écrit ton nom\r\ndans le sable\r\nMais la vague l’a effacé\r\nNous avons gravé ton nom\r\nsur un arbre\r\nMais l’écorce est tombée\r\nNous avons incrusté\r\nton nom\r\ndans le marbre\r\nMais la pierre a cassé\r\nNous avons enfoui\r\nton nom\r\ndans nos coeurs\r\nEt le temps l’a gardé\r\n\r\n',NULL,NULL,NULL,'',10072,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(175,1,NULL,NULL,NULL,'[Thought-151]\r\n[Thought-158]\r\npage 1 test\r\n\r\n[ORN-05]\r\n\r\n“The mystery of our life\r\nis in God’s hands.“\r\n(Jean.XXIII)\r\n\r\nl am rejoining\r\nthe ones l loved,\r\nand l am waiting\r\nfor those l love.\r\n',NULL,NULL,NULL,'',10073,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(176,1,NULL,NULL,NULL,'[prayer-369]\r\n[23rd_Psalm]\r\n\r\nThe Lord is my shepherd; I shall not want.\r\n He maketh me to lie down in green pastures: He leadeth me beside the still waters.\r\n He restoreth my soul: He leadeth me in the paths of righteousness for His name\'s sake.\r\n Yea, though I walk through the valley of the shadow of death, I will fear no evil:\r\n for Thou art with me: Thy rod and Thy staff they comfort me.\r\n Thou preparest a table before me in the presence of mine enemies: \r\nthou anointest my head with oil: my cup runneth over. \r\nSurely goodness and mercy shall follow me all the days of my life:\r\n and I will dwell in the house of the Lord for ever.\r\n\r\n\r\nO God,\r\nThe Creator and Redeemer\r\nof all the faithful,\r\ngrant to the souls of Thy\r\nservants departed the\r\nremission of all their sins;\r\nthat through pious\r\nsupplications they may\r\nbtain the pardon\r\nwhich they have always\r\ndesired of Thy Mercy\r\nwho livest and\r\nreignest World\r\nwithout end.\r\nAmen.\r\n',NULL,NULL,NULL,'',10073,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(177,1,NULL,NULL,NULL,'[pensée-125]\r\n[pensée-101]\r\n\r\nSeigneur,\r\nvous m’avez appelé\r\nprès de vous,\r\nj’ai laissé seuls ceux\r\nque j’aimais tant,\r\nprenez ma place\r\nauprès d’eux.\r\n\r\n\r\n« C’est grand la mort\r\nc’est plein  de vie dedans. »\r\n(Félix Leclerc)\r\n',NULL,NULL,NULL,'',100074,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(178,1,NULL,NULL,NULL,'[poème-003]\r\n\r\nNous avons écrit ton nom\r\ndans le sable\r\nMais la vague l’a effacé\r\nNous avons gravé ton nom\r\nsur un arbre\r\nMais l’écorce est tombée\r\nNous avons incrusté\r\nton nom\r\ndans le marbre\r\nMais la pierre a cassé\r\nNous avons enfoui\r\nton nom\r\ndans nos coeurs\r\nEt le temps l’a gardé\r\n',NULL,NULL,NULL,'',100074,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(179,1,NULL,NULL,NULL,'[prière-325]\r\ntest \r\n\r\nNotre Père\r\nqui es aux cieux,\r\nque ton nom soit sanctifié,\r\nque ton règne vienne,\r\nque ta volonté soit faite\r\nsur la terre comme au ciel.\r\nDonne-nous aujourd’hui\r\nnotre pain de ce jour.\r\nPardonne-nous nos\r\noffenses comme nous\r\npardonnons aussi à ceux\r\nqui nous ont offensés.\r\nEt ne nous soumets pas\r\nà la tentation,\r\nmais délivre-nous du mal.\r\n(Amen)\r\n\r\n[ORN-06]\r\n',NULL,NULL,NULL,'',100075,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(180,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',100075,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(181,1,NULL,NULL,NULL,NULL,NULL,NULL,'100076-photo.jpg','',100076,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(182,1,NULL,NULL,NULL,'[pensée-101]\r\n\r\nSeigneur,\r\nvous m’avez appelé\r\nprès de vous,\r\nj’ai laissé seuls ceux\r\nque j’aimais tant,\r\nprenez ma place\r\nauprès d’eux.\r\n\r\n\r\n[ORN-01]\r\n',NULL,NULL,'100077-photo.jpg','',100077,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(183,1,NULL,NULL,NULL,'[prayer-355]\r\n\r\nThe Lord is my shepherd;\r\nI shall not want.\r\nHe maketh me to lie down\r\nin green pastures;\r\nHe leadeth me besides\r\nthe still waters;\r\nHe restoreth my soul;\r\nHe leadeth me in the\r\npaths of\r\nlighteousness\r\nfor His name\'s sake\r\nYea though I walk through\r\nthe \r\n\r\nthey comfort me.\r\nTh