0:00:00'),(219,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',100098,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(220,1,NULL,NULL,NULL,'[formule-19]\r\n[In_memoriam...]\r\n\r\nIn memoriam\r\nof\r\n<I>Pierre Tremblay</i>\r\n\r\n\r\nL’expression sincère de\r\nvotre sympathie\r\nlors du décès de\r\nM. Armand Racine\r\nnous a touchés\r\nprofondément.\r\nNous vous prions\r\nd’accepter\r\nnotre profonde\r\nreconnaissance.\r\nLes membres de\r\nla famille Racine.\r\n\r\n[ORN-06]\r\n',NULL,NULL,'100099-photo.jpg','',100099,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(221,1,NULL,NULL,NULL,'[prière-325]\r\n\r\nNotre Père\r\nqui es aux cieux,\r\nque ton nom soit sanctifié,\r\nque ton règne vienne,\r\nque ta volonté soit faite\r\nsur la terre comme au ciel.\r\nDonne-nous aujourd’hui\r\nnotre pain de ce jour.\r\nPardonne-nous nos\r\noffenses comme nous\r\npardonnons aussi à ceux\r\nqui nous ont offensés.\r\nEt ne nous soumets pas\r\nà la tentation,\r\nmais délivre-nous du mal.\r\n(Amen)\r\n',NULL,NULL,NULL,'',100099,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(222,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',100100,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(223,1,NULL,NULL,NULL,'[prière-320]\r\n\r\nParents chéris, frères et\r\nsoeurs bien-aimés,\r\nau revoir !\r\nC’est pour vous un\r\nmartyre bien cruel de me\r\nvoir mourir si jeune.\r\nConsolez-vous, tournez\r\nvos regards vers le ciel et\r\npensez qu’un jour\r\nviendra où vous mourrez\r\ntous et lorsque vous\r\nviendrez chercher votre\r\nrécompense, je serai à\r\nvotre rencontre, suppliant\r\nDieu à mon tour, de vous\r\nouvrir la porte du ciel.\r\nVous nous l’aviez donné,\r\nSeigneur, pour être la joie\r\nde nos yeux, le rayon de\r\nsoleil de notre vie;\r\nvous nous le reprenez\r\naujourd’hui par un\r\ndessein mystérieux, devant lequel nous nous\r\ninclinons sans le\r\ncomprendre; que votre\r\nvolonté soit faite\r\n',NULL,NULL,'100101-photo.jpg','',100101,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(224,1,NULL,NULL,NULL,'[prayer-340]\r\n\r\nOur Father\r\nwho art in heaven,\r\nhallowed be thy name;\r\nThe kingdom come;\r\nThy will be done\r\non earth as\r\nit is in heaven.\r\nGive us this day\r\nour daily bread;\r\nAnd forgive us\r\nour trespasses\r\nas we forgive those\r\nwho trespass against us;\r\nAnd lead us not\r\ninto temptation, but\r\ndeliver us from evil;\r\nFor Thine is\r\nthe kingdom, and\r\nthe power, and glory,\r\nfor ever and ever,\r\nAmen. \r\n',NULL,NULL,NULL,'',100101,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(225,1,NULL,NULL,NULL,'',NULL,NULL,'100102-photo.jpg','',100102,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(226,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',100102,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(227,1,NULL,NULL,NULL,NULL,NULL,NULL,'100103-photo.jpg','',100103,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(228,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',100104,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(229,1,NULL,NULL,NULL,NULL,NULL,NULL,'100105-photo.bmp','',100105,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(230,1,NULL,NULL,NULL,NULL,NULL,NULL,'100106-photo.jpg','',100106,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(231,1,NULL,NULL,NULL,NULL,NULL,NULL,'100107-photo.gif','',100107,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(232,1,NULL,NULL,NULL,NULL,NULL,NULL,'100108-photo.jpg','',100108,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(233,1,NULL,NULL,NULL,'[pensée-105]\r\n\r\n\r\n« J’ai rejoint\r\nceux que j’aimais et j’attends\r\nceux que j’aime. »\r\n(Bossuet)\r\n',NULL,NULL,'100109-photo.jpg','',100109,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(234,1,NULL,NULL,NULL,'[formule-08]\r\n\r\nVous avez eu\r\nla délicatesse\r\nlors du décès de\r\nMme Berthe Gauvin-Barrière de nous témoigner par\r\nun geste personnel\r\nla part que vous preniez\r\nà notre peine.\r\nNous en avons été\r\nsincèrement touchés\r\net tenons à vous dire\r\nnotre profonde\r\ngratitude.\r\n\r\nM. Jean-Paul Barrière, Yves, Louise et Marie-Claude.\r\n\r\n',NULL,NULL,NULL,'',100109,'0000-00-00