ans ce chemin inconnu,\r\nvous nous avez guidés…\r\nMerci\r\n\r\n[ORN-05]\r\n\r\nÀ la douce\r\nmémoire de\r\nPierre Tremblay\r\n\r\n',NULL,NULL,'6003057-photo.bmp','',6003057,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3610,1,NULL,NULL,NULL,'[formule-24]\r\n\r\nPour le réconfort que vous nous avez apporté lors du décès de M. Armand Racinenous vous assurons de notre vive reconnaissance et nous vous remercions sincèrement. Madame Carole Racine Claude, André et Mireille\r\n',NULL,NULL,NULL,'',6003057,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3611,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003065-photo.jpg','',6003065,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3612,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003073-photo.jpg','',6003073,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3613,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003081-photo.jpg','',6003081,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3614,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003099-photo.jpg','',6003099,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3615,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003115-photo.jpg','',6003115,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3616,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6003123,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3617,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6003123,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3618,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003131-photo.jpg','',6003131,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3619,1,NULL,NULL,NULL,'[A_la_douce...]\r\n\r\nÀ la douce\r\nmémoire de\r\nLuce Bisson\r\n\r\ndécédée le 4 août 2013\r\n\r\n',NULL,NULL,NULL,'',6003149,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3620,1,NULL,NULL,NULL,'[poème-008]\r\n\r\nIl n’y a aucun remède contre la mort, sinon, d’avoir profité de la période qui sépare celle-ci de la naissance. \r\n\r\n\r\n[ORN-15]\r\n\r\n',NULL,NULL,NULL,'',6003149,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3621,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003164-photo.jpg','',6003164,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3622,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003172-photo.jpg','',6003172,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3623,1,NULL,NULL,NULL,'[A_la_douce...]\r\n\r\nÀ la douce\r\nmémoire de\r\nJean-Paul Jodoin\r\n\r\ndécédé le 2 août 2013\r\n',NULL,NULL,'6003180-photo.jpg','',6003180,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3624,1,NULL,NULL,NULL,'Son sourire et son sens de l\'humour gagnaient l\'affection de tous ceux qu\'il rencontrait.Un père et un homme généreux avec une grande écoute. Toujours prêt à aider les autres. Sa simplicité et sa joie de vivre étaient contagieuse.C\'est simple, on lui parlait, on l\'aimait!\r\n\r\n\r\nornement #50\r\n\r\nLa famille Jodoin tient à vous remercier pour votre présence et vos paroles remplies de compassion. D\'avoir ceux que nous aimons auprès de nous a été vraiment apprécié!\r\n',NULL,NULL,NULL,'',6003180,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3625,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003198-photo.jpg','',6003198,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3626,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003206-photo.jpg','',6003206,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3627,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003214-photo.jpg','',6003214,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3628,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003222-photo.jpg','',6003222,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3629,1,NULL,NULL,NULL,'[pensée-129]\r\n\r\nSeigneur, pour ceux\r\nqui croient en toi\r\nla vie n’est pas détruite,\r\nelle est transformée.\r\n\r\n[ORN-05]\r\n',NULL,NULL,'6003230-photo.jpg','',6003230,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3630,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6003230,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3631,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003248-photo.jpg','',6003248,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3632,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003255-photo.jpg','',6003255,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(3633,1,NULL,NULL,NULL,NULL,NULL,NULL,'6003263-photo.jpg','',6003263,'0