s\r\nand justice all our days.\r\nThen, after serving\r\nYou in the fellowship\r\nof Your Church,\r\nwith strong faith,\r\nconsoling hope,\r\nand perfect love for all,\r\nmay we joyfully\r\ncome to Your Kingdom.\r\nWe ask this through\r\nChrist Our Lord.\r\n\r\nGod, Your days are\r\nwithout end,\r\nYour mercies\r\nbeyond counting.\r\nHelp us always to\r\nremember that life is\r\nshort and the day\r\nof our death is\r\nknown to You alone.\r\nMay Your Holy\r\nSpirit lead us\r\nto live in holiness\r\nand justice all our days.\r\nThen, after serving\r\nYou in the fellowship\r\nof Your Church,\r\nwith strong faith,\r\nconsoling hope,\r\nand perfect love for all,\r\nmay we joyfully\r\ncome to Your Kingdom.\r\nWe ask this through\r\nChrist Our Lord.\r\n',NULL,NULL,'6050538-photo.jpg','6050538-photo2.jpg',6050538,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7935,1,NULL,NULL,NULL,'[prière-317]\r\n\r\nIl s’est éteint doucement,\r\nen paix avec son Dieu,\r\nlaissant les siens dans une douleur profonde.\r\nSa droiture, la bonté de\r\nson coeur lui gagnaient\r\nl’affection de tous\r\nceux qui l’entouraient.\r\nIl laisse à sa famille, un\r\nnom respecté et honoré,\r\nle souvenir d’un mari\r\naimant et dévoué, la\r\nmémoire d’un père qu’on\r\npeut chérir avec fierté.\r\nPère, là-haut, veille sur\r\nnous, souvent,\r\nviens nous béni\r\n',NULL,NULL,'6050538-back.jpg','',6050538,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7936,1,NULL,NULL,NULL,'[prière-325]\r\n\r\nNotre Père\r\nqui es aux cieux,\r\nque ton nom soit sanctifié,\r\nque ton règne vienne,\r\nque ta volonté soit faite\r\nsur la terre comme au ciel.\r\nDonne-nous aujourd’hui\r\nnotre pain de ce jour.\r\nPardonne-nous nos\r\noffenses comme nous\r\npardonnons aussi à ceux\r\nqui nous ont offensés.\r\nEt ne nous soumets pas\r\nà la tentation,\r\nmais délivre-nous du mal.\r\n(Amen)\r\n',NULL,NULL,'6050546-photo-crop.jpg','6050546-photo2-crop.jpg',6050546,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7937,1,NULL,NULL,NULL,'[p