s que vos\r\nparents sont près de vous,\r\ndisponibles à vos prières,\r\nprêts à vous aider.\r\nCe n’est pas de mourir\r\nqu’il faut se préoccuper,\r\nmais de bien vivre.\r\nChers enfants,\r\nne nous oubliez pas,\r\nrestez unis entre vous.\r\n',NULL,NULL,NULL,'',6050835,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7969,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050843-photo.JPG','',6050843,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7970,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050850-photo.jpg','',6050850,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7971,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050868-photo.jpg','',6050868,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7972,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050876-photo.jpg','',6050876,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7973,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050884-photo.jpg','',6050884,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7974,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050892-photo.jpg','',6050892,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7975,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050900-photo.jpg','6050900-photo2.jpg',6050900,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7976,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050918-photo.jpg','6050918-photo2.jpg',6050918,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7977,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050926-photo.jpg','',6050926,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7978,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050934-photo.jpg','',6050934,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7979,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050942-photo.jpg','',6050942,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7980,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050959-photo.jpg','',6050959,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7981,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050975-photo.jpg','',6050975,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7982,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050983-photo.jpg','',6050983,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7983,1,NULL,NULL,NULL,NULL,NULL,NULL,'6050991-photo.jpg','',6050991,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7984,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051007-photo.jpg','',6051007,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7985,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051015-photo.jpg','',6051015,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7986,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051023-photo.jpg','',6051023,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7987,1,NULL,NULL,NULL,'A la douce mémoire\r\nde Lucienne Mayer\r\n1936-2017',NULL,NULL,'6051031-photo-crop.jpg','',6051031,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7988,1,NULL,NULL,NULL,'[prière-313]\r\n\r\nChers enfants, je vous ai\r\nquittés non sans\r\ndéchirement; mais\r\nj’ai espéré dans le\r\nSeigneur.\r\nQuelle joie de contempler\r\nle Dieu d’amour et de lui\r\nconfier les secrets\r\nde vos coeurs.\r\nNe m’oubliez pas,\r\ncar  je suis toujours\r\navec vous.\r\nJe vous mets dans les\r\nbras du Seigneur afin\r\nqu’il vous protège.\r\nNe pleurez pas,\r\nje vais à Dieu.\r\nJ’ai rejoint\r\nceux que j’aimais\r\net j’attends\r\nceux que j’aime.\r\n(Bossuet)\r\n',NULL,NULL,NULL,'',6051031,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7989,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051049-photo.jpg','',6051049,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7990,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051064-photo.msg','',6051064,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7991,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051072-photo.msg','',6051072,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7992,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051080-photo.jpg','6051080-photo2.jpg',6051080,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7993,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051098-photo.jpg','',6051098,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7994,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051106-photo.pdf','',6051106,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7995,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051114-photo.jpg','',6051114,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(7996,1,NULL,NULL,NULL,NULL,NULL