rop.jpg','',6051254,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8012,1,NULL,NULL,NULL,'',NULL,NULL,'6051262-photo-crop.jpg','',6051262,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8013,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6051262,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8014,1,NULL,NULL,NULL,'[Thought-154]\r\n\r\nThe loss of a mother\r\nis the first sorrow in life,\r\nthat we face without her.\r\n',NULL,NULL,'6051288-photo-crop.jpg','6051288-photo2-crop.jpg',6051288,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8015,1,NULL,NULL,NULL,'[poème-003]\r\n\r\nNous avons écrit ton nom\r\ndans le sable\r\nMais la vague l’a effacé\r\nNous avons gravé ton nom\r\nsur un arbre\r\nMais l’écorce est tombée\r\nNous avons incrusté\r\nton nom\r\ndans le marbre\r\nMais la pierre a cassé\r\nNous avons enfoui\r\nton nom\r\ndans nos coeurs\r\nEt le temps l’a gardé\r\n',NULL,NULL,'6051288-back-crop.jpg','',6051288,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8016,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051296-photo-crop.jpg','',6051296,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8017,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051304-photo-crop.jpg','',6051304,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8018,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051312-photo-crop.jpg','',6051312,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8019,1,NULL,NULL,NULL,'[formule-14]\r\n\r\nLors du décès de\r\nMonsieur\r\nArmand Racine\r\nvos gestes d’amitié et\r\nvos délicates attentions\r\nnous ont touchés\r\nprofondément.\r\nNous vous en sommes\r\ntrès reconnaissants.\r\nMme Carole Racine\r\nClaude, André et\r\nMireille.\r\n',NULL,NULL,'6051320-photo-crop.jpg','6051320-photo2-crop.jpg',6051320,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8020,1,NULL,NULL,NULL,'[prayer-353]\r\n\r\nOur Lady of Guadalupe,\r\nmystical rose.\r\nSince you are\r\nThe ever-Virgin Mary\r\nand Mother of the true God,\r\nobtain for us from\r\nyour holy Son the grace\r\nof a firm and a sure hope.\r\nIn the midst of our anguish,\r\nstruggle, and distress,\r\ndefend us from the power\r\nof the enemy, and at\r\nthe hour of our death\r\nreceive our soul in Heaven.\r\nAmen. \r\n',NULL,NULL,'6051320-back-crop.jpg','',6051320,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8021,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051353-photo-crop.jpg','',6051353,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8022,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051361-photo-crop.jpg','',6051361,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8023,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051395-photo-crop.jpg','',6051395,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8024,1,NULL,NULL,NULL,'',NULL,NULL,'6051403-photo-crop.jpg','',6051403,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8025,1,NULL,NULL,NULL,'',NULL,NULL,'6051403-back-crop.jpg','',6051403,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8026,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051411-photo-crop.jpg','6051411-photo2-crop.jpg',6051411,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8027,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051429-photo-crop.jpg','',6051429,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8028,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051452-photo-crop.jpg','',6051452,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8029,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051460-photo-crop.png','6051460-photo2-crop.jpg',6051460,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8030,1,NULL,NULL,NULL,'En souvenir de\r\nAlbert Rousseau\r\nné le 27 mai 1942\r\ndécédé le 15 février 2017',NULL,NULL,'6051478-photo-crop.jpg','',6051478,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8031,1,NULL,NULL,NULL,'[poème-002]\r\n\r\nNe soyez pas tristes,\r\noubliez votre chagrin,\r\ncar là où je suis\r\nmaintenant,\r\nil n’y a ni larmes,\r\nni souffrance,\r\nni maladie, ni douleur.\r\nLe bonheur que je vis\r\ndans les cieux\r\nest encore plus grand\r\nque celui que j’ai connu\r\nsur terre.\r\nJ’ai trouvé auprès de Dieu\r\nla lumière et l’amour infini.\r\nRéjouissez-vous,\r\nIl veille sur moi\r\net m’a accordé le repos\r\net la paix éternelle.\r\