,'En souvenir de\r\nRoger Savard\r\nné le 09 octobre 1940\r\ndécédé le 20 février 2017',NULL,NULL,'6051726-photo-crop.jpg','',6051726,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8049,1,NULL,NULL,NULL,'[pensée-122]\r\n\r\nLe coeur retient\r\nce que la mémoire oublie.\r\n',NULL,NULL,NULL,'',6051726,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8050,1,NULL,NULL,NULL,'À la mémoire de\r\n\r\nNée le 3 mars 1935 décédé le 19 février 2017\r\n\r\n',NULL,NULL,'6051734-photo-crop.jpg','',6051734,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8051,1,NULL,NULL,NULL,'[poème-001]\r\n\r\n« Au bout du chemin\r\nde la vie,\r\nse trouve un seuil qui\r\nnous conduit\r\nde l’autre côté\r\nde la nuit,\r\nvers la lumière\r\noù nous attendent\r\nle repos et la paix... »\r\n\r\n+ Ornement 006\r\n',NULL,NULL,NULL,'',6051734,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8052,1,NULL,NULL,NULL,'',NULL,NULL,'6051742-photo-crop.jpg','6051742-photo2-crop.jpg',6051742,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8053,1,NULL,NULL,NULL,'',NULL,NULL,'6051742-back-crop.jpg','',6051742,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8054,1,NULL,NULL,NULL,'[prayer-370]\r\n\r\nGod on His throne in\r\nheaven looked round at\r\nhis flowers so fair,\r\nand then sought a blossom\r\non earth to add to those\r\nHe had there. To be part\r\nof such heavenly company,\r\nthe bloom must be pure\r\nand sweet, and the little\r\nbud that was chosen,\r\nwas the child who\r\nplayed at our feet.\r\nSorrow is great at\r\nthe loss of our child,\r\nat parting with one\r\nwe love. But the parting\r\nwas made that\r\nour child might go\r\nto brighten the\r\nheavens above.\r\n',NULL,NULL,'6051759-photo-crop.jpg','6051759-photo2-crop.jpg',6051759,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8055,1,NULL,NULL,NULL,'[prayer-369]\r\n\r\nO God,\r\nThe Creator and Redeemer\r\nof all the faithful,\r\ngrant to the souls of Thy\r\nservants departed the\r\nremission of all their sins;\r\nthat through pious\r\nsupplications they may\r\nbtain the pardon\r\nwhich they have always\r\ndesired of Thy Mercy\r\nwho livest and\r\nreignest World\r\nwithout end.\r\nAmen.\r\n',NULL,NULL,'6051759-back-crop.jpg','',6051759,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8056,1,NULL,NULL,NULL,'[formule-23]\r\n\r\nLes membres de\r\nla famille Racine\r\ndésirent vous exprimer\r\nleur plus vive\r\nreconnaissance\r\npour la sympathie\r\nque vous leur\r\navez témoignée\r\nlors du décès de\r\nM. Armand Racine.\r\n',NULL,NULL,'6051775-photo-crop.jpg','6051775-photo2-crop.jpg',6051775,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8057,1,NULL,NULL,NULL,'[pensée-128]\r\n\r\nLe souvenir\r\nde l’être aimé\r\nne peut s’éteindre\r\ncar vous le perpétuez.\r\n',NULL,NULL,'6051775-back-crop.jpg','',6051775,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8058,1,NULL,NULL,NULL,'[formule-23]\r\n\r\nLes membres de\r\nla famille Racine\r\ndésirent vous exprimer\r\nleur plus vive\r\nreconnaissance\r\npour la sympathie\r\nque vous leur\r\navez témoignée\r\nlors du décès de\r\nM. Armand Racine.\r\n',NULL,NULL,'6051783-photo-crop.jpg','6051783-photo2-crop.jpg',6051783,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8059,1,NULL,NULL,NULL,'[poème-004]\r\n\r\nComme une photo\r\nque l’on aime revoir,\r\nun beau souvenir\r\nd’anniversaire,\r\nun mot ou un sourire\r\nqui peut nous émouvoir,\r\nceux qui nous sont chers\r\nrevivent dans notre\r\nmémoire comme\r\nsi c’était hier.\r\nQue de fois un simple\r\ncoucher de soleil\r\néveille en notre esprit\r\navec une douce nostalgie\r\nces moments privilégiés\r\npartagés avec\r\nun être aimé !\r\nOui, la mémoire possède\r\nce pouvoir de faire vivre\r\npar la pensée\r\nceux  qui nous ont quittés.\r\n(Étienne Rioux)\r\n',NULL,NULL,'6051783-back-crop.jpg','',6051783,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8060,1,NULL,NULL,NULL,'',NULL,NULL,'6051791-photo-crop.jpg','',6051791,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8061,1,NULL,NULL,NULL,'',NULL,NULL,'6051791-back-crop.jpg','',6051791,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8062,1,NULL,NULL,NULL,'[prière-313]\r\n\r\nChers enfants, je vous ai\r\nquittés non sans\r\ndéchirement; mais\r\nj’ai espéré dans le\r\nSeigneur.\r\nQuelle joie de contempler\r\nle Dieu d’amour et de lui\r\nconfier les secrets\r\nde vos coeurs.\r\nNe m’oubliez pas,\r\ncar  je suis toujours\r\navec vous.\r\nJe vous mets dans les\r\nbras du Seigneur afin\r\nqu’il vous protège.\r\nNe pleurez pas,\r\nje vais à Dieu.\r\nJ’ai rejoint\r\nceux que j’aimais\r\net j’attends\r\nceux que j’aime.\r\n(Bossuet)\r\n',NULL,NULL,'6051809-photo-crop.jpg','',6051809,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8063,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6051809,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8064,1,NULL,NULL,NULL,'',NULL,NULL,'6051825-photo-crop.jpg','',6051825,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8065,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6051825,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8066,1,NULL,NULL,NULL,'[A_la_douce...]\r\n\r\nÀ la douce\r\nmémoire de\r\nPierre Tremblay\r\n\r\n\r\n1942-2017\r\n\r\n',NULL,NULL,'6051833-photo-crop.jpg','',6051833,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8067,1,NULL,NULL,NULL,'[pensée-113]\r\n[poème-001]\r\n\r\n« Au bout du chemin\r\nde la vie,\r\nse trouve un seuil qui\r\nnous conduit\r\nde l’autre côté\r\nde la nuit,\r\nvers la lumière\r\noù nous attendent\r\nle repos et la paix... »\r\n\r\nOrnement 22\r\n\r\n\r\n\r\nOn ne doit\r\ngarder du passé\r\nque les plus\r\ndoux souvenirs.\r\n',NULL,NULL,NULL,'',6051833,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8068,1,NULL,NULL,NULL,'[prayer-328]\r\n[poème-003]\r\n[In_memoriam...]\r\n\r\nIn memoriam\r\nof\r\n<I>Pierre Tremblay</i>\r\n\r\nHis good character and\r\nthe kindness of his heart\r\nwon the affection\r\nof his loved ones.\r\nHe was loved by all.\r\nThose who knew him,\r\nhave honored him with their esteem,\r\nand have expressedit with\r\nsympathies after his death.\r\nHis death has left\r\na profound\r\nwound in our hearts.\r\nRemember me, friends,\r\nas l have done\r\nthe will of the Lord. \r\n',NULL,NULL,'6051841-photo-crop.jpg','6051841-photo2-crop.jpg',6051841,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8069,1,NULL,NULL,NULL,'[prayer-371]\r\n\r\nO God, through the death\r\nof your Son on the cross,\r\nyou have overcome\r\ndeath for us.\r\nThrough his burial and\r\nresurrection from the\r\ndead you have made\r\nthe grave a holy place\r\nand restored us\r\nto eternal life.\r\nWe pray for those\r\nwho died  believing in\r\nJesus and buried\r\nwith him in the hope\r\nof rising again.\r\nGod of the living\r\nand the dead may those\r\nwho faithfully believe in\r\nyou on earth praise you\r\nforever in the\r\njoy of heaven.\r\nWe ask this through\r\nChrist our Lord.\r\nAmen.\r\n',NULL,NULL,'6051841-back-crop.jpg','',6051841,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8070,1,NULL,NULL,NULL,'[Thought-153]\r\n\r\nSee the new life\r\nl am beginning\r\nand not the one\r\nl have ended.\r\n',NULL,NULL,'6051858-photo-crop.jpg','6051858-photo2-crop.jpg',6051858,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8071,1,NULL,NULL,NULL,'[Thought-158]\r\n\r\n“The mystery of our life\r\nis in God’s hands.“\r\n(Jean.XXIII)\r\n',NULL,NULL,'6051858-back-crop.jpg','',6051858,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8072,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051866-photo-crop.jpg','6051866-photo2-crop.jpg',6051866,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8073,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051874-photo-crop.jpg','',6051874,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8074,1,NULL,NULL,NULL,NULL,NULL,NULL,'6051882-photo-crop.jpg','6051882-photo2-crop.jpg',6051882,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8075,1,NULL,NULL,NULL,'[formule-23]\r\n\r\nLes membres de\r\nla famille Racine\r\ndésirent vous exprimer\r\nleur plus vive\r\nreconnaissance\r\npour la sympathie\r\nque vous leur\r\navez témoignée\r\nlors du décès de\r\nM. Armand Racine.\r\n',NULL,NULL,'6051890-photo-crop.jpg','6051890-photo2-crop.jpg'