,NULL,NULL,NULL,NULL,NULL,'6052849-photo-crop.jpg','',6052849,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8169,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052864-photo-crop.jpg','',6052864,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8170,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052872-photo-crop.jpg','',6052872,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8171,1,NULL,NULL,NULL,'A la mémoire de \r\nNoëlla Hurtubise\r\n1930-2017',NULL,NULL,'6052880-photo-crop.jpg','',6052880,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8172,1,NULL,NULL,NULL,'[prière-308]\r\n\r\nIl est toujours pénible\r\nde devoir se séparer\r\nd’un être cher.\r\nMais sachez accepter\r\ncette séparation avec\r\nfoi et confiance,\r\nen pensant aux choses\r\nmerveilleuses qu’il me\r\nsera donné de connaître\r\ndans cette nouvelle vie.\r\nJe ne vous dis pas adieu,\r\nmais au revoir.\r\nPensez à moi\r\nsans tristesse et attendez\r\navec confiance le moment\r\noù vous me rejoindrez.\r\n',NULL,NULL,NULL,'',6052880,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8173,1,NULL,NULL,NULL,'En souvenir de\r\nJacqueline Filion Lussier\r\n1943-2017\r\n',NULL,NULL,'6052898-photo-crop.png','',6052898,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8174,1,NULL,NULL,NULL,'[poème-004]\r\n\r\nComme une photo\r\nque l’on aime revoir,\r\nun beau souvenir\r\nd’anniversaire,\r\nun mot ou un sourire\r\nqui peut nous émouvoir,\r\nceux qui nous sont chers\r\nrevivent dans notre\r\nmémoire comme\r\nsi c’était hier.\r\nQue de fois un simple\r\ncoucher de soleil\r\néveille en notre esprit\r\navec une douce nostalgie\r\nces moments privilégiés\r\npartagés avec\r\nun être aimé !\r\nOui, la mémoire possède\r\nce pouvoir de faire vivre\r\npar la pensée\r\nceux  qui nous ont quittés.\r\n(Étienne Rioux)\r\n\r\n[ORN-26]\r\n',NULL,NULL,NULL,'',6052898,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8175,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052906-photo-crop.jpg','',6052906,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8176,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052914-photo-crop.jpg','',6052914,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8177,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052922-photo-crop.jpeg','',6052922,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8178,1,NULL,NULL,NULL,'[formule-20]\r\nEn souvenir de\r\nGilles Séguin\r\ndécédé le 13 mars 2017\r\n\r\nÀ la mémoire\r\nd’un être exceptionnel\r\nM. Armand Racine\r\nSa famille tient\r\nà vous remercier\r\nde vos chaleureux\r\net réconfortants\r\ntémoignages de\r\nsympathie\r\nlors du décès survenu\r\nle 13 février 2017.\r\n\r\nLes membres de la famille\r\n',NULL,NULL,'6052930-photo-crop.jpg','',6052930,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8179,1,NULL,NULL,NULL,'',NULL,NULL,NULL,'',6052930,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8180,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052948-photo-crop.jpg','',6052948,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8181,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052955-photo-crop.jpg','',6052955,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8182,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052963-photo-crop.jpeg','',6052963,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8183,1,NULL,NULL,NULL,NULL,NULL,NULL,'6052971-photo-crop.jpg','',6052971,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8184,1,NULL,NULL,NULL,'A la douce mémoire de\r\nPearl Roy\r\nnée le 20 octobre 1942\r\ndécédée le 16 mars 2017',NULL,NULL,'6052989-photo-crop.jpg','',6052989,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8185,1,NULL,NULL,NULL,'[poème-002]\r\n\r\nNe soyez pas tristes,\r\noubliez votre chagrin,\r\ncar là où je suis\r\nmaintenant,\r\nil n’y a ni larmes,\r\nni souffrance,\r\nni maladie, ni douleur.\r\nLe bonheur que je vis\r\ndans les cieux\r\nest encore plus grand\r\nque celui que j’ai connu\r\nsur terre.\r\nJ’ai trouvé auprès de Dieu\r\nla lumière et l’amour infini.\r\nRéjouissez-vous,\r\nIl veille sur moi\r\net m’a accordé le repos\r\net la paix éternelle.\r\n',NULL,NULL,NULL,'',6052989,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8186,1,NULL,NULL,NULL,NULL,NULL,NU