-00-00 00:00:00','0000-00-00 00:00:00'),(8345,1,NULL,NULL,NULL,'[A_la_douce...]\r\nA la douce mémoire de\r\nAnne Chatelain\r\nnée le 19 janvier 1961\r\ndécédée le 29 avril 2017\r\nÀ la douce\r\nmémoire de\r\nPierre Tremblay\r\n\r\n',NULL,NULL,'6054753-photo-crop.jpg','',6054753,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8346,1,NULL,NULL,NULL,'[prière-313]\r\n\r\nChers enfants, je vous ai\r\nquittés non sans\r\ndéchirement; mais\r\nj’ai espéré dans le\r\nSeigneur.\r\nQuelle joie de contempler\r\nle Dieu d’amour et de lui\r\nconfier les secrets\r\nde vos coeurs.\r\nNe m’oubliez pas,\r\ncar  je suis toujours\r\navec vous.\r\nJe vous mets dans les\r\nbras du Seigneur afin\r\nqu’il vous protège.\r\nNe pleurez pas,\r\nje vais à Dieu.\r\nJ’ai rejoint\r\nceux que j’aimais\r\net j’attends\r\nceux que j’aime.\r\n(Bossuet)\r\n',NULL,NULL,NULL,'',6054753,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8347,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054761-photo-crop.jpg','',6054761,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8348,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054779-photo-crop.jpg','6054779-photo2-crop.jpg',6054779,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8349,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054795-photo-crop.jpg','',6054795,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8350,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054803-photo-crop.jpg','',6054803,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8351,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054811-photo-crop.png','',6054811,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8352,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054829-photo-crop.png','',6054829,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8353,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054845-photo-crop.jpg','',6054845,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8354,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054852-photo-crop.jpg','',6054852,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8355,1,NULL,NULL,NULL,NULL,NULL,NULL,'6054860-photo-crop.jpg','',6054860,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(83