,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8975,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061543-photo-crop.jpg','',6061543,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8976,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061550-photo-crop.jpg','',6061550,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8977,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061568-photo-crop.jpg','',6061568,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8978,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061576-photo-crop.png','',6061576,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8979,1,NULL,NULL,NULL,'[A_la_douce...]\r\n\r\nÀ la douce\r\nmémoire de\r\nRéjeanne Masson Cadotte\r\n1929-2017\r\n\r\n',NULL,NULL,'6061584-photo-crop.jpg','',6061584,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8980,1,NULL,NULL,NULL,'[prière-308]\r\n\r\nIl est toujours pénible\r\nde devoir se séparer\r\nd’un être cher.\r\nMais sachez accepter\r\ncette séparation avec\r\nfoi et confiance,\r\nen pensant aux choses\r\nmerveilleuses qu’il me\r\nsera donné de connaître\r\ndans cette nouvelle vie.\r\nJe ne vous dis pas adieu,\r\nmais au revoir.\r\nPensez à moi\r\nsans tristesse et attendez\r\navec confiance le moment\r\noù vous me rejoindrez.\r\n\r\nC\'est la vie\r\n  et voilà\r\n',NULL,NULL,NULL,'',6061584,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8981,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061592-photo-crop.jpg','',6061592,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8982,1,NULL,NULL,NULL,'In lovely memory of\r\nNutin McFarland\r\nborn on June 15, 1999\r\npassed away on November 02, 2017',NULL,NULL,'6061600-photo-crop.jpg','',6061600,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8983,1,NULL,NULL,NULL,'To all my Family, Friends and Relations.\r\nI encourage you to be thankful. Thankful for life and the time we spent together. \r\nPlease consider that the Creator brought our paths together on Mother Earth for a reason. Appreciate the important moments you spend with people. Let the positive and beautiful things in life define what you hold in your heart. Share them with your loved ones and the rest of the world. Experience your light and love with as much life as you can. Be who you are by following your Spirit. In doing so, our paths will always cross.\r\nI am in a good place now, with our heavenly Father, Creator and my Ancestors.\r\nWhen you think of me, know that I am talking to you. When you feel a nice breeze, I am walking with you and listening to you. When the wind is in your hair, it’s me encouraging you to take another step forward on your path. When the big wind comes, it’s me, Nutin, being myself, getting your attention to change the way you think. \r\nAll my Relations, Nutin (The Wind). \r\n',NULL,NULL,NULL,'',6061600,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8984,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061618-photo-crop.jpg','6061618-photo2-crop.jpg',6061618,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8985,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061626-photo-crop.jpg','',6061626,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8986,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061634-photo-crop.jpg','',6061634,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8987,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061642-photo-crop.jpg','',6061642,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8988,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061659-photo-crop.jpg','6061659-photo2-crop.jpg',6061659,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8989,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061675-photo-crop.jpg','',6061675,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8990,1,NULL,NULL,NULL,NULL,NULL,NULL,'6061683-photo-crop.jpg','',6061683,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8991,1,NULL,NULL,NULL,'En souvenir de \r\nEstevao Amorim\r\n1930-2017',NULL,NULL,'6061691-photo-crop.jpg','',6061691,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8992,1,NULL,NULL,NULL,'[pensée-127]\r\n\r\nIl nous a\r\ntellement apporté\r\nqu’on ne pourra\r\njamais l’oublier !\r\n\r\n\r\nORNEMENT 17',NULL,NULL,NULL,'',6061691,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(8993,1,NULL,NU