ce...]\r\nA\r\nÀ la douce\r\nmémoire de\r\nMichel Grenier\r\nnée le 01 février 1947\r\ndécédé le \r\n20 décembre 2017\r\n',NULL,NULL,'6063150-photo-crop.jpg','',6063150,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9123,1,NULL,NULL,NULL,'[poème-002]\r\n\r\nNe soyez pas tristes,\r\noubliez votre chagrin,\r\ncar là où je suis\r\nmaintenant,\r\nil n’y a ni larmes,\r\nni souffrance,\r\nni maladie, ni douleur.\r\nLe bonheur que je vis\r\ndans les cieux\r\nest encore plus grand\r\nque celui que j’ai connu\r\nsur terre.\r\nJ’ai trouvé auprès de Dieu\r\nla lumière et l’amour infini.\r\nRéjouissez-vous,\r\nIl veille sur moi\r\net m’a accordé le repos\r\net la paix éternelle.\r\n\r\nORNEMENT des pneus\r\n',NULL,NULL,NULL,'',6063150,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9124,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063168-photo-crop.jpg','',6063168,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9125,1,NULL,NULL,NULL,'In memory of\r\nSue Mullins\r\n1951-2017\r\n\r\n\r\n',NULL,NULL,'6063176-photo-crop.jpg','',6063176,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9126,1,NULL,NULL,NULL,'\r\nThoughts:   159\r\n\r\nForms          43',NULL,NULL,NULL,'',6063176,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9127,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063184-photo-crop.jpg','',6063184,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9128,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063192-photo-crop.jpg','',6063192,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9129,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063200-photo-crop.png','',6063200,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9130,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063218-photo-crop.png','',6063218,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9131,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063226-photo-crop.jpg','6063226-photo2-crop.jpg',6063226,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9132,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063234-photo-crop.jpg','',6063234,'0000-00-00 00:00:00','0000-00-00 00:00:00'),(9133,1,NULL,NULL,NULL,NULL,NULL,NULL,'6063242-photo-crop